import React from "react";

const Home = () => {
    return (
        <>
            <section id="header" className="d-flex align-items-center">
                <div className="container-{breakpoint}">
                    <div className="row">
                        <div className="col"></div>
                    </div>
                </div>
            </section>
        </>
    );
}

export default Home;
